import React, { Component } from 'react';
import './index.css';

class Footer extends Component {
  render() {
    return (
      <footer className="Footer">
        <p>All rights reserved. Prices subject to change without notice.</p> <p>Liam Rottkov &copy;2019</p>
      </footer>
    );
  }
}


export default Footer;
